import { createStore } from 'vuex';
import authModule from './authenticate/index.js';

const store = createStore({
    modules: {
        authenticate:authModule
    },
    state() {
        return {
            userId: 'c4'
        };
    },
    getters: {
        userId(state) {
            return state.userId;
        }
    }
});

export default store;
